import { FiMenu } from 'react-icons/fi'

const Navbar = () => {
  return (
    <header className='container border-solid border-gray-200 border-b-2 h-4 p-4 sticky inset-0S'>
      <FiMenu />
    </header>
  );
}

export default Navbar;
